const express = require('express')
const app = express();
const df = require('dialogflow-fulfillment');

app.post('/', express.json(), (req, res) => {
  const agent = new df.WebhookClient({
    request: req,
    response: res
  });

  function filterSettingData(agent) {
    let result = [];
    const index = agent.query.indexOf(' ');
    if (index !== -1) {
      const searchString = 
        agent.query.substr(index + 1, agent.query.length - index).toLowerCase();
      settingList.forEach(s => {
        if (s.name.toLowerCase().includes(searchString) ||
            s.description.toLowerCase().includes(searchString) ||
            s.category.name.toLowerCase().includes(searchString)) {
          result.push(makeDFObjectFromSetting(s));
        }
      });
    } else {
      settingList.forEach(s => {
        result.push(makeDFObjectFromSetting(s));
      });
    }

    let payload = {
      "richContent": result
    };
    agent.add(new df.Payload(agent.UNSPECIFIED, payload, { sendAsMessage: true, rawPayload: true }));
  }

  function filterExhibitData(agent) {
    let result = [];
    const index = agent.query.indexOf(' ');
    if (index !== -1) {
      const searchString = 
        agent.query.substr(index + 1, agent.query.length - index).toLowerCase();
      exhibitList.forEach(e => {
        if (e.name.toLowerCase().includes(searchString) ||
            e.description.toLowerCase().includes(searchString) ||
            e.category.name.toLowerCase().includes(searchString) ||
            e.countryOfOrigin.name.toLowerCase().includes(searchString) ||
            e.price.toString().includes(searchString) || 
            e.tourTime.toString().includes(searchString)) {
          result.push(makeDFObjectFromExhibit(e));
        }
      });
    } else {
      exhibitList.forEach(e => {
        result.push(makeDFObjectFromExhibit(e));
      });
    }

    let payload = {
      "richContent": result
    };
    agent.add(new df.Payload(agent.UNSPECIFIED, payload, { sendAsMessage: true, rawPayload: true }));
  }

  let intentMap = new Map();
  intentMap.set('setting', filterSettingData);
  intentMap.set('exhibit', filterExhibitData);
  agent.handleRequest(intentMap);
})

function makeDFObjectFromSetting(setting) {
  return [
    {
      "type": "image",
      "rawUrl": setting.imageURL,
      "accessibilityText": "Dialogflow across platforms"
    },
    {
      "type": "info",
      "title": setting.name,
      "subtitle": setting.description.substr(0, 200).trim() + '...',
      "actionLink": "http://localhost:4200/setting/details/" + setting.id
    }];
}

function makeDFObjectFromExhibit(exhibit) {
  return [
    {
      "type": "image",
      "rawUrl": exhibit.imageURL,
      "accessibilityText": "Dialogflow across platforms"
    },
    {
      "type": "info",
      "title": exhibit.name,
      "subtitle": exhibit.description.substr(0, 200).trim() + '...',
      "actionLink": "http://localhost:4200/exhibit/" + exhibit.id + '/0'
    }];
}



